import React from 'react'
import ProductCard from './ProductCard'
import useGenerateId from '../../hooks/useGenerateId'

export default function ProductList({products, logo, title, price}) {

  const generateId = useGenerateId()

  return (
    <div>
      <h1>PRODUCT LIST</h1>
      {/* RENDER THE LIST OF PRODUCTS BY MAPPING
      props> https://www.youtube.com/watch?v=5s8Ol9uw-yM
      list rendering > https://www.youtube.com/watch?v=5s8Ol9uw-yM
      */}

      {
         products.map(product => <ProductCard products={products} logo={product.logo.url} title={product.title} price={product.price} id={generateId('id')} /> )

      }

    </div>
  )
}
